INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3350033581012', 'Bûchettes glacées', 'Crème glacée à la vanille 74%: lait entier-sucre-crème fraiche-beurre concentré-sirop de glucose déshydraté-lait écrémé en poudre-jaune d\'oeuf-émulsifiant:mono-et diglycérides d\'acides gras-stabilisants: farine de graines de caroube, gomme guar-arôme naturel de vanille 0,1%-gousse de vanille épuisée en poudre.  Enrobage au chocolat noir 18,8% : chocolat noir à 70% de cacao 13,2% (pâte de cacao, sucre, beurre de cacao, émulsifiant: lécithines de soja, arôme naturel de vanille)-beurre concentré-huile de tournesol.  Inclusions et décor 7,2 % : éclats de cacao en grains caramélisés (cacao 5%, sucre cristallisé) Traces de céréales contenant du gluten et de fruits à coque Les informations en gras sont destinées aux personnes intolérantes ou allergiques.', 'https://static.openfoodfacts.org/images/products/335/003/358/1012/front_fr.4.400.jpg', '18', '11', '24', '20', '', '3.7', '0.1', '0.0393700787401575', '', '1');

