VALUES ('3350033581043', 'Bûche glacée', 'Sorbet plein fruit à la mangue et au fruit de la passion 54,6 %:purée de mangue 21% - eau - sucre - sirop de glucose déshydraté-jus concentré de fruit de la passion 2,7% - stabilisants : farine de graines de caroube, gomme guar - protéines de lait. Crème glacée au mascarpone avec inclusions de noisettes caramélisées 23,5% : lait entier sucre crème fraiche noisettes caramélisées 1,8% (noisettes 1,7%, sucre, sirop de glucose, miel) - lactose et protéines de lait - mascarpone 1,2% ( crème, lait entier, correcteur d\'acidité:acide citrique)- dextrose - émulsifiant:mono - et diglycérides d\'acides gras - stabilisants: farine de graines de caroube, gomme guar.  Enrobage à la mangue 10,7 % : purée de mangue 2,4 %-eau-sucre - sirop de sucre inverti cristallisé-sirop de glucose-fructose-sirop de glucose - correcteurs d\'acidité: acide citrique, phosphates de potassium, citrates de calcium - gélifiants: pectines, carraghénanes - concentré de carthame concentré de citron.  Biscuit à l\'amande et à la noix de coco 8,5% : sucre - blanc d\'æuf-farine de blé-amande en poudre 0,8% - fécule de pomme de terre - noix de coco râpée 0,2 % - amidon de maïs - stabilisant: gomme xanthane - gluten de blé Décors 2,7%: cubes de mangue 1,9%, groseilles 0,8% Traces de soja et d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/335/003/358/1043/front_fr.8.400.jpg', '2.9', '1.3', '34', '30', '', '1.8', '0.06', '0.0236220472440945', '', '0');

