VALUES ('3350033581098', 'Buchettes glacées', 'Crème glacée au chocolat noir avec éclats de caramel aromatique au beurre et à la crème 86,8% : lait entier - sucre - chocolat noir du Costa Rica à 64% de cacao 8,7% (pâte de cacao du Costa Rica, sucre, beurre de cacao, arôme naturel de vanille) - caramel au beurre et à la crème 6,9% (sucre, sirop de glucose, beurre 1,2%, crème 1%, eau) - crème fraîche-cacao en poudre de l\'Ouest-sirop de glucose déshydraté - lait écrémé en poudre - lactose et protéines de lait - émulsifiant: mono - et aromatique d\'Afrique diglycérides d\'acides gras-stabilisants :farine de graines de caroube, gomme guar.  Flocage aux chocolats 10,6% : chocolat au lait 3,1% (sucre, beurre de cacao, lait entier en poudre, pâte de cacao, émulsifiant: écithines de soja, arôme naturel de vanille) - beurre de cacao - huile de tournesol - chocolat noir à 70% de cacao 2,1% (pâte de acao, sucre, beurre de cacao, émulsifiant: lécithines de soja, arôme naturel de vanille)  Ganache au chocolat noir 1,7% : chocolat noir à 50% de cacao 0,8% (pâte de cacao, sucre, beurre de cacao, émulsifiant:lécithines de soja, arôme naturel de vanille)- crème (crème, stabilisant: carraghénanes)- sirop de glucose de mais. ubes de caramel au lait 0,9%: sucre - lait concentré sucré 0,3% - sirop de glucose - lait entier en poudre 0,05% - humectant: sorbitols-émulsifiants: lécithines de soja, mono - et diglycérides d\'acides gras. Traces d\'oeuf, de céréales contenant du gluten et de fruits à coque.', 'https://static.openfoodfacts.org/images/products/335/003/358/1098/front_fr.4.400.jpg', '', '', '', '', '', '', '', '', '', '1');

