VALUES ('3350033582248', 'Le pave poulet crudites', 'Pain spécial 54% (farine de blé, eau, huile de colza, semoule de blé dur, sel, levure, _gluten_ de blé, farine de _blé_ malté, levure désactivée), filet de poulet cuit traité en salaison 18% (filet de poulet 14% (origine: France), eau, dextrose, amidon, huile de tournesol, sel, sucre brun, arôme naturel), tomate 9%, salade 6%, sauce (eau, huile de colza, amidon, jaune d\'_œuf_,  _moutarde_ (eau, graines de _moutarde_, vinaigre d\'alcool, sel, épices), vinaigre de vin, vinaigre d\'alcool, sel, stabilisant: farine de graines de caroube, épaississants gomme guar et gomme xanthane, extraits d\'épices), _fromage_ blanc (_lait_ pasteurisé, _crème_ fraiche pasteurisée, ferments lactiques), _moutarde_ à l\'ancienne (eau, vinaigre d\'alcool, graines de _moutarde_, téguments de graines de _moutarde_, sel, acidifiant acide citrique, arômes naturels, antioxydant disulfite de potassium, curcuma), ciboulette. Fabriqué dans un atelier qui utilise poisson, soja, graines de sésame, fruits à coque, crustacés, céleri, mollusques. Les informations en gras sont destinées aux personnes intolérantes ou allergiques.', 'https://static.openfoodfacts.org/images/products/335/003/358/2248/front_fr.4.400.jpg', '7.4', '0.6', '29', '2.8', '', '8.8', '0.99', '0.389763779527559', '', '1');

